def acquire(self, blocking=True):

    with self._inner_lock:

        lock_acquired = self._lock.acquire(False)

        if lock_acquired:

            return True

        elif not blocking:

            return False



        release_event = threading.Event()

        self._pending_threads.append(release_event)



    release_event.wait()

    return self._lock.acquire()
